import { Fragment } from "react";
import { useParams, Route } from "react-router-dom/cjs/react-router-dom.min";

const QuoteDetails = () => {
  const params = useParams();
  return (
    <Fragment>
      <p>{params.quoteId}</p>
      <Route path="/quotes"></Route>
    </Fragment>
  );
};
export default QuoteDetails;
